import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="/App-Lab/AppLab.png" className="App-logo" alt="logo" />
        <p>
          This is the check in site!
        </p>
      </header>
    </div>
  );
}

export default App;
